/*!

=========================================================
* Argon Design System React - v1.1.2
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-design-system-react
* Copyright 2023 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-design-system-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Route, Routes, Navigate } from "react-router-dom";

import "assets/vendor/nucleo/css/nucleo.css";
import "assets/vendor/font-awesome/css/font-awesome.min.css";
import "assets/scss/argon-design-system-react.scss?v1.1.0";

import Index from "views/Index.js";
import Landing from "views/examples/Landing.js";
import Login from "views/examples/Login.js";
import Profile from "views/examples/Profile.js";
import Register from "views/examples/Register.js";
import { Alert } from "reactstrap";
import AccessDeniedPage from "views/examples/accesDenied";
import PrivateRoutes from "utils/privateRoutes"
import Admin from "views/Backoffice/Admin";




const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <BrowserRouter>
 <Routes>
      <Route path="/" element={<Landing />} exact />
      <Route path="/index" element={<Index />} exact />
      <Route path="/home-page" element={<Landing />} exact />
      <Route path="/login-page" element={<Login />} exact />
      <Route path="/error-page" element={<Alert />} exact />
      <Route path="/accesDenied" element={<AccessDeniedPage />} exact />
      <Route element={<PrivateRoutes />}>
        <Route path="/profile-page" element={<Profile />} exact />
        <Route path="/register-page" element={<Register />} exact />
        <Route path="/admin/*" element={<Admin />} />
      </Route>
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  </BrowserRouter>
);
